import { Box, Button, HStack, VStack } from '@chakra-ui/react';

const SidebarContent = ({ onClick }) => (
	<VStack>
		<HStack onClick={onClick} w="100%">
			<Text>Deniz Kaptan</Text>
		</HStack>
		<Box onClick={onClick} w="100%">
			All Habits
		</Box>
		<Box onClick={onClick} w="100%">
			Afternoon
		</Box>
	</VStack>
);

export default SidebarContent;
